#include <stdio.h>
#include <stdlib.h>

typedef struct {
    int x;
    void (*print)(int);
} Object;

void printObject(int x) {
    printf("x = %d\n", x);
}

int main(int argc, char *argv[]) {
    if (argc < 2) return 1;
    int value = atoi(argv[1]);
    Object obj = {value, printObject};
    obj.print(obj.x);
    return 0;
}

#include <iostream>
using namespace std;

class Car {
    string model;
public:
    Car(string m) {
        model = m;
    }
    void show() {
        cout << "Model: " << model << endl;
    }
};

int main(int argc, char* argv[]) {
    if (argc < 2) return 1;
    string input = argv[1];
    Car c(input);
    c.show();
    return 0;
}

class Animal {
    String name;
    public Animal(String name) {
        this.name = name;
    }
}

class Dog extends Animal {
    public Dog(String name) {
        super(name);
    }
    void bark() {
        System.out.println(name + " says woof");
    }
}

public class Main {
    public static void main(String[] args) {
        String name = args.length > 0 ? args[0] : "Default";
        Dog d = new Dog(name);
        d.bark();
    }
}
